6034 Arena_introduce 競技場規則
 1.玩家積分決定排名,每隔3天進行最終排名,系統自動發放排名獎勵,之後積分重置;
 2.每日可免費挑戰10次（勝負都會扣挑戰次數）,戰敗會進入挑戰冷卻時間;
 3.將當前刷出的5個對手擊敗後可領取5殺獎勵,每日只能領取一次;中途刷新則擊殺數量置零;
 4.挑戰根據戰鬥結果和對決雙方排名計算積分與榮耀點,被挑戰者不獲得積分與榮耀點;
 5.榮耀點用於啟動競技場稱號,榮耀點不會清除;
 6.競技場稱號級別越高,加成的屬性越高,需求的榮耀點也越多; <列1>nil</列1>

6035 Trial_introduce 試煉規則
 1.每日可免費挑戰1次,每個試煉星域擁有進入條件,共用挑戰次數;
 2.試煉進度永久保存,滿星通關的不可再次挑戰;
 3.
 4.試煉中可返回主城進行飛船培養等操作,返回試煉裡,飛船屬性將更新為最新的;
 5.試煉中可使用重置功能立即結束本次試煉;
 6.試煉關卡只擁有首殺獎勵,但可累積通關星數領取星數寶箱; <列1>nil</列1>

6036 Planet_introduce 星系規則
 1.資源採集----三種資源礦,等級越高,存儲量越大,採集速度受玩家等級與主城等級的影響;採集完成後部隊會帶著採集的資源自動返回,附帶郵件提醒。需佈陣出征隊伍,佔用出征佇列;部分礦佔據怪物,需擊敗才能採集,不消耗體力值;
 2.資源掠奪----當該資源礦已被其他玩家佔領時,可以發起掠奪,戰勝後可搶奪部分已採集的資源並自動佔領資源礦繼續採集餘下的礦;需佈陣出征隊伍,佔用出征佇列,消耗體力;
 3.打撈殘骸----擁有打撈時間;殘骸等級越高,獎勵越豐厚;加入星盟後,會有額外的星盟禮包獎勵;無需佈陣出征隊伍,但佔用出征佇列,消耗體力;
 4.銷毀行星帶--行星帶掉落各類道具,銷毀時概率觸發怪物戰鬥;需佈陣出征隊伍,佔用出征佇列,消耗體力;
 5.突襲--------針對當前區域活動的玩家;戰勝後可獲得超額獎勵;需佈陣出征隊伍,佔用出征佇列,消耗大量體力; <列1>nil</列1>
